var app=app||{};app.ShelfCollection=Backbone.Collection.extend({model:app.Shelf,initialize:function(){this.on("setactive",this.setActive)},setActive:function(e){this.models.forEach(function(t){t.get("name")===e.get("name")?(t.set("active",!0),app.pubSub.trigger("viewingNewShelf",t.get("nested"))):t.set("active",!1),app.pubSub.trigger("renderShelves")})}});